// src/data/data.js

export const departmentsData = [{
        name: 'Biological Input Supply',
        items: [
            { id: 1, title: 'Bio-Fertilizer A', description: 'High-quality organic fertilizer for a wide range of crops.' },
            { id: 2, title: 'Bio-Pesticide B', description: 'Effective and safe bio-pesticide to protect your plants.' },
            { id: 3, title: 'Seeds - Corn', description: 'Hybrid corn seeds with high yield potential.' },
        ],
    },
    {
        name: 'Chemical Input Supply',
        items: [
            { id: 4, title: 'Chemical Fertilizer X', description: 'Fast-acting fertilizer for immediate nutrient boost.' },
            { id: 5, title: 'Chemical Pesticide Y', description: 'Broad-spectrum pesticide for severe pest infestations.' },
            { id: 6, title: 'Herbicide Z', description: 'Powerful herbicide for controlling weeds.' },
        ],
    },
];
